    text175a78bcbf49bc081aeadb1c36b54368: {
      type: "text",
      content: "И. О.: Шофёр. И чего водили? Какой транспорт? Что такое ППЧ?",
      id: "text175a78bcbf49bc081aeadb1c36b54368"
    },
