    text5994742276ff17084c50be842b8236f5: {
      type: "text",
      content: "И. О.: Советское?",
      id: "text5994742276ff17084c50be842b8236f5"
    },
    textda94693b64f31aa11faa6dbd521d92fd: {
      type: "text",
      content: "{06:53:53}",
      id: "textda94693b64f31aa11faa6dbd521d92fd"
    },
    strong2cca67102b5524370adc086c9ab05467: {
      path: [
        "text81f5bfa1438f44036cf052f5f39924bd",
        "content"
      ],
      endOffset: 6,
      startOffset: 0,
      id: "strong2cca67102b5524370adc086c9ab05467",
      type: "strong"
    },
    text81f5bfa1438f44036cf052f5f39924bd: {
      type: "text",
      content: "Г. К.: Они работают на фабрике, на консервной. И, значит, когда мы уходили, они говорят: «Приходите, приходите». Тем более, что узнали, что мы – земляки, там объявились. И мы пошли в это училище. Там мы оделися в морскую форму. Там, оказывается, склады морской формы. Полно – выбирай! А нас ещё мало выплывало туда, и мало кто знал, что… Это ж только первый день! Уже на третий, на второй, на четвёртый – туда уже все ринулись, кто остался в живых и, кто от бауэров узнал, что вот так и так, в Нойштадте есть училище. И начали туда. А четвёртого числа к нам приехало наше командование. ",
      id: "text81f5bfa1438f44036cf052f5f39924bd"
    },
