    text6d5c7b0133b196edbd035d18dbbbaae1: {
      type: "text",
      content: "Г. К.: Да, господи, закрывать нечего было – тут всё морозом… /Смеётся/ Господи, что там? А мы как-то стесняемся ещё, да? И вот один за одним, стараемся друг от друга не отстать. И первый, который вылез. Первый –остальные за ним. А перед нами дом – ну, может, три этажа. Ну, может, трёхэтажный. Я точно уже теперь не могу сказать. Может, двухэтажный. Но факт тот, что вот этот первый, который бежал, он прямо в подъезд. {06:30:18}",
      id: "text6d5c7b0133b196edbd035d18dbbbaae1"
    },
