    text792841a655714e26f2b7d468393ce4a0: {
      type: "text",
      content: "Но на мне стал выходить мороз. Холод. Дело в том, что меня вот так бросать стало. Я, я не находил… Я, благодаря тому, что я залез под сетку, вот под эту кровать, и вот это меня, видно, сдерживало. А тут, может, даже кто-то и на сетке или лежал, или сидел, что она не могла подниматься. Меня вот так кидать начало – вот этот холод из меня начал выходить. Ну, вы видели замёрзшего там или кошку, или котёнка? Видели, как он вот так дрожит? Вот так и я. Вот так из меня холод стал выходить. Я, значит, бросало меня, бросало. И, может… Какое там время прошло? Не знаю. Но факт тот, что крикнули: «Раус». Ну, «раус» – это всем нам понятно, что такое – вылазь, выходи. Раус – уходи, выходи. Да, и мы по одному. Ну, кто там успевает как. Вылазим, вылазим. И вдруг уже на палубе этого катерка, из палубы мостик такой вот, вот чуть-чуть так бугристый, не прямой. А я не знаю, чего он такой, чуть-чуть овальный? И перила. И – «раус». Перед нами город, порт. Порт Нойенштадт. И мы, значит, это, гуськом-гуськом все мы…",
      id: "text792841a655714e26f2b7d468393ce4a0"
    },
    textdb26db041ef2515f5a1e9e61c5db2f2a: {
      type: "text",
      content: "{06:27:24}",
      id: "textdb26db041ef2515f5a1e9e61c5db2f2a"
    },
    textf23f7aa3f1191271ff79f4c44f95a9f9: {
      type: "text",
      content: "Да, и потом последний раз ещё. Каким мы там путём? Или они ещё что-то подключили или как-то развернули катер, что я всё-таки приблизился к этому катеру. И они мне подают багор – и я цепляюсь. И они меня, подвели, подвели под это, под ступеньки. Я еле-еле, значит, вылез, полез туда, где-то в катер. Ну, мне показали. Полез, а там уже наших было, может, человек десять. А, может быть, человек пять. Может, шесть. Но там вот эти откидные кровати были, ихнии, сетки такие. Видно, морячки эти спят там, на этих сетках. Они вот так подвешены были. А то они опущенные. И там, под этими сетками, уже наши ребята были. И там где-то и Эдик. Я слышу разговоры – некоторые разговаривают, рассказывают там что-то. Ну, короче говоря, куда-то плывём. Куда и что? Кто знает? ",
      id: "textf23f7aa3f1191271ff79f4c44f95a9f9"
    },
