    text6a77c702592b2386dc26c343c8a0b5c6: {
      type: "text",
      content: "Г. К.: Мотор. И, наоборот, у меня появилась волна, и ещё дальше отбило от этого, от катера. Они подают мне крюк, а я не могу. И я ещё дальше. А потом, я уже сильно, я уже руками недвижимый почти что был. Я уже руками вот так, сильно, не мог подавать. Это я, может, даже и думаю, что я Эдику даже, может быть, мешал, когда плыли. Нет, ну не мешал, но и мало, наверное, с меня помощи было, да? Ну, короче говоря, они это, они тогда выключили. И они ну уже там уже маневрировали. Я знаю? Снова подают мне – я снова не могу зацепиться. Ребята эти начали ругаться между собой: «Вайтефарен». То есть давайте плыть дальше. «Сакраменто». Значит, ну по-своему они. «Сакраменто» это какая-то ругань по-немецки, да? «Вайтефарен» – давайте дальше плыть. Кто-то там, может быть, их был командир катера, кто давал такую команду. А я же слышу, я же всё-таки некоторые слова знал немецкие, да? ",
      id: "text6a77c702592b2386dc26c343c8a0b5c6"
    },
