    textcf1abb1f2d3cdd8a891c001dbe8dc0dd: {
      type: "text",
      content: "Г. К.: Да. Кто как. У кого как сложилось. Трудно понять. Но, когда мы уже немножко отплыли, мы видим, что навстречу нам оттуда не плывут, а что-то машут нам. Вот так. Показывают, что, мол, мы так поняли, что туда нельзя плыть. А в чём, а почему, что? Мы так и не знали. И мы приостановились. Приостановились – что делать? Смотрим: прямо на нас идёт катерок, небольшой катерок. И вот этот катер. На катере морячки, молоденькие немецкие морячки, молодые ребята. Такие, как мы, годами, да? И они «бац» и прямо подплывают к нам, и подают этот багор. Вот эти противопожарные багры. Ну, палки такие, и на конце – железный крюк такой, да? И они раз, и прос…просовывают этому, Эдику, подают. Эдик хватается за этот крюк. Они повели, повели его. Там такая, четыре или пять там это ступенек, лестница, спущена лестница. Он полез. Смотрю, а Эдик мой полез в катер. А теперь –мне, а я отбился от катера. Ну, видно, то ли волны, то ли от лопастей этого меня отнесло, да. Потом слышу – они мне подают. Ещё не подают, а заработал этот…",
      id: "textcf1abb1f2d3cdd8a891c001dbe8dc0dd"
    },
