    text67251000a0b5fada1de26960409a66e8: {
      type: "text",
      content: "Там их столько вложили, там их столько забили немцы, в основном немцы, потому что эти эсвау…эсваубандиты, они же прибывали сила, заменяя, надо строить лагерь, они же не будут строить, они все каппы, форарбайтера. И били их, убивали, там поляков столько уложено, да? А теперь в 41-ом году, когда русские уже стали прибывать, с тюрем начали везти по концлагерям русских. Вот тут-то, поляки немецкий язык хорошо знают, они уже научились за это время, они научились уже по-немецки говорить очень хорошо, да. И они говорят хорошо, и они все стали, а они нужные для эсэсовцев, для этих, для капп, и для блокэльстеров, там для всех. Значит, они нужны, как переводчики. И они роль играют все переводчиков. И тем не менее, поскольку они и сами так безжалостно выжили, так же они и… и обращаются и с теми, над которыми они теперь владеют, да.",
      id: "text67251000a0b5fada1de26960409a66e8"
    },
