    text628217bd1dd96eefc95da667f39d42de: {
      type: "text",
      content: "Я спустил штаны, нагнулся – н мне показал. И вот говорит же считать, и он меня этим прибором как врезал, я как заору, не своим /смеётся/ голосом я заорал. А он говорит: «О, рубич!» – говорит, – «малепо маль». Ещё только один раз ударил, а ты уже заорал как. Они дают и по двадцать пять, и по десять, и по пятнадцать. Ну, кому, кому сколько схочется, столько он и бьёт, если он так решил бить. А если он носаками бьёт, значит, он носаками бьёт, да. И вот значит: «ауштейн» – «вставай снова, подымайся». Ну, короче говоря, я раза четыре или пять я помню, я всё помню, раза четыре или пять, вот так он меня всё заставлял подыматься, /посторонний шум/ и я подымался и он уже, и я не считал, и он не считал там. А может, он и считал, я не знаю. Но я, куда там мне считать. Я никогда так не битый, и это «цехен», – говорит, «считай». /смеётся/. Да. Ну, я упал, уже может за пятым, может быть за шестым, а может, за четвёртым разом, я не знаю, я упал. Я уже больше не поднялся. Я… он меня там, видно… я потерял сознание. ",
      id: "text628217bd1dd96eefc95da667f39d42de"
    },
