    text6cc99bd28312915ce51f5d6ba7bb8958: {
      type: "text",
      content: "И он меня там раз ударит, два ударит. Я упал, значит ауштейн, бьёт носками меня. «Гоозерундо». Но я же ещё не битый, я не знаю, что такое «Гоозерундо». Оказывается, «штаны спускай». «Унд аж вох» – становись вот так на четвереньках. «Аж» – это жопа. «Аж вох». Значит, «гоозерундо аж вох» – ну, вот так должен я встать. «Унт цейле» – и считать, чтобы я считал. Чтоб он бил, а я чтоб говорил: «айнц, цвай». /смеётся/ Ну, так в лагере было заведено, но я же ещё не бородатый, я ещё ну, можно сказать, сколько я там пробыл, я ещё мало был. А тем более я ещё не битый даже был. Там то, что голодный там, то что, а так, чтобы меня били, ещё не приходилось вот так. Да, ну, я тут распоясался, завязанный на чём-то было, да? ",
      id: "text6cc99bd28312915ce51f5d6ba7bb8958"
    },
