    text676a846a89d833621c453c15b59dffa8: {
      type: "text",
      content: "Там именно мы всегда, когда приходим на работу, мы там, ну, распределяют по рабочим местам. Наш каппо, кого туда, кого туда, в разные места посылает, да. Мы там останавливаемся уже. Там эта площадь выложена кирпичом. Никакой это не асфальт, не бетон, кирпичом, да. И там мы, когда нам обед привозят, суп там, в обед без хлеба, а такую баланду эту привозят, да. Так мы там, значит, всегда обедаем. Почему? Во-первых, потому что там чисто, площадь, там же только грязь на огородничьей команде, а здесь чисто, во-первых. А во-вторых, там стоят вот вот эти, ну, прямо, сложенный этот кирпич, сложен такими штабелями, большими штабелями и малыми штабелями, разные. Это площадь специально для выгрузки из печей кирпича. И этот кирпич тёплый. И мы вот, когда приходим туда обедать, когда нам туда бачки с супом привозят туда. И там нам раздают суп, а мы тогда этот суп, сядешь там где-то возле этой, ну, возле этого кирпича. И в спину, в это, прогреешь спину, ну, там приятно. Вот мы всегда там обедали, и там же мы всегда строились идти уже в лагерь. Когда кончено, рабочий день кончился. Там дадут команду, мы идём туда строимся. И, значит, он ведёт меня туда. Вот этот эсэсовец. Приводит: «Ну, майне либе, – говорит, мой любимый, говорит – «гоозерундо аж вох унт цейле». Ну, я ещё этого не понимал, что это такое /смеётся/. Да. А я: «никх ферштейн», а я ему говорю, что «никх ферштейн». И стою перед ним, а он же не понимает, что такое «никх ферштейн». Он понимал, что его все должны понимать. Их кто понимал, кто не понимал /смеётся/. Всё, эсэсовец, это же, что ты, это ж Бог – эсэсовец, да?",
      id: "text676a846a89d833621c453c15b59dffa8"
    },
