    textb8514aa83d796c0cb7e82112de18f66d: {
      type: "text",
      content: "И вот так тросточкой меня, нет, ещё не ударил. Снова там он что-то мне говорил, а сам вот этой тросточкой роется в песке. И вдруг, и раз, закраснел и закраснел помидорчик. А он тогда мне говорит: «ду бист ду нихт ферштейн!» И меня вот этой тросточкой так, как стоял я, по голове он меня как ударит. Вот. Как ударил меня, мне так как бы в глазах, не то, что потемнело, ну, так аж потемнело в глазах. Ну, я не сильно так сразу обратил внимание тогда, ещё кровь видно была у меня, да. И вот так капает это по мне кровь. Ну, он разрыл, разрыл. Ему эти помидоры ж не нужны, зачем они ему. Говорит: «Ком!». И ведёт меня вот сюда до кирпичного завода, а там возле кирпичного завода, а там аппельплац. ",
      id: "textb8514aa83d796c0cb7e82112de18f66d"
    },
