    text9641676b96ebf3f0670389f0ea68decb: {
      type: "text",
      content: "Но это шланг, я откровенно вам говорю, это бычачий половой орган. Это специально они заказывали где-то на мясокомбинатах, что, я это, не знаю, это примерно слухи всё, да. Но я знаю, что это заказывали всегда эсэсовцы по концлагерям. Это самое практичное, самое больное, и не нужно им с дерева там резать или… или вот эти резиновые шланги носить, когда вот это они использовали они для этого. Ну, у него вот тут вот так висит. Они там обрабатывали медицина как-то, ну, это уже не наше дело, да? И вот он, значит, этой тросточкой. Вот так я подбежал и стою перед ним. Ну, «Вас ис мейн либе?» а я: «никх ферштейн!». Мы уже кое-что понимали по-немецки. В особенности вот такие всякие дикие шутки над нами, мы их все понимали. Шла или шлаген там или халон хн коп, ну то есть «ударь в голову» там, «по голове ударь». Ну, мы уже много всё-таки лагерных слов понимали, да? И он, значит, вот этой тросточкой, ну: «Вас ис?» а я: «никх ферштейн». Прежде всего, это все заключенные, в особенности русские, прежде всего, говоришь: «никх ферштейн», то есть, чтоб ты, мол, отстал от меня. Ну, а я: «никх ферштейн!». - «Никх ферштейн?».",
      id: "text9641676b96ebf3f0670389f0ea68decb"
    },
