    textfaf48e7b223b17916079805460484a87: {
      type: "text",
      content: "И вот на одном колесе там по доскам мы её, значит, на участок там, где какие удобряют, вот этот помидор, ну, во-первых, рассада только вышла, сразу колышки забиваем, подвязываем, и он вот так растёт. Потом специально, и помидор вот такой высоты растёт, стебель. А на нём же плоды. Потом мы подвязываем, ну, мы там работаем. Понимаете? И вот, значит, это, вот они оттуда привёз… не они, песок нам кто-то другой привёз, я не знаю кто. И мы берём вот этот кары, шубкары вот эти, тачки, берём песок и везём туда на это, пересыпаем с перегноем, и даём удобрение под помидоры, под огурцы там, под всякое вот это, то, что мы выращиваем, да. Там специально такое решето, под его пересевают с песком, мы вместе перемешиваем перегонной там какой-то, да? И по доскам мы вот таки возим. А вот эти вагонетки они проходят как раз рядом. Вот допустим вот эта как бы вот эта куча песка, а тут дальше болото, и вот эти вагонетки на самом краю берега вот этого болота эта линия эта, ну, железнодорожная, будем говорить, да, колея. И вот вагонетка по этой линии, значит, ходит. Ну, и я, значит, что, ну, я уже лагерный, уже многих знал в лагере, и я же тоже работал сначала на вот этих вагонетках работал. Пока ослаб, я там сильно ослаб. ",
      id: "textfaf48e7b223b17916079805460484a87"
    },
