      content: "Г. К.: С землёй и засыпает. А здесь – нам привезли для огородничьей команды кучу. Вот такая куча, как вот эта комната – песок. Для чего. Для того, чтобы мы вот этот песок… берём доски или же там, это, погода вообще мокрая очень. И вот эти одноколёсные, эти, шубкары, называются, вот так берёшь.",
