    textf3e0c292cfdca9e7b6ec94085ef1ec01: {
      type: "text",
      content: "Такая комната у него большая, но он эсесовец там с этим с нашивкой этой, ну, фашистский вот этот знак, да? Его очень мы боялись, конечно, и мастера эти гражданские они его тоже боялись, но тем не менее, если Саша сделал будильник, то, что ему кусок хлеба завернул в бумаге и сунул. Там у нас конвейер, столики вот такие, и дальше, дальше вот такой целый ряд. Ну, это, ну, значит, а Саша мне и говорит, поскольку мы же земляки, он Днепропетровской области, мы уже нашлися как земляки друг друга, да. И это, мы так вот держимся, ждём… земляки, да земляки, а он, а Саша: «Слушай, Гриша, ты возьмёшь утренний порцион его, который в бараке дают, заберёшь за меня или вечером там». Ну, когда он не голодный, тогда вот, ну, вот получил он такую поддержку. Ну, короче говоря, так дружили, мы так сдружилися, и мне же теперь, когда я на огородничью команду вот это попал, мне же тоже хотелось. Я помидорок там могу съесть, меня тут никто, ни один эсэсовец не заметит, как я съем помидор, правда же? Я не голодный, в смысле вот этого. Мне же ещё хочется и его угостить. ",
      id: "textf3e0c292cfdca9e7b6ec94085ef1ec01"
    },
