    textf051ea778c3027c924042b9658661b09: {
      type: "text",
      content: "И когда узнали там, в этом, в месапе, узнали, эти, гражданские мастера, которые приезжали с Гамбурга на велосипедах и работали вот с нами вместе над вот этими, это очень ответственная, это шеф был видно богатый там какой-то... Ну, кто его знает… Подробностей я не знаю, но факт тот, что вот эти гражданские мастера, они узнали, шо Саша хороший часовой мастер, и они у них нет там дома будильника, сломался, ну, как обычно это же... Они привозят прямо Саше и дают. А Саша, у нас у каждого здесь лупа, мы вот конвейером, ну как мне надо, вот сейчас бы я показал и всё было бы прекрасно... Да, и вот, значит, а что ему стоит этому гражданскому мастеру привезти там кусок хлеба за то, что он там ему сделал будильник, да? Он ему привёз и дал, ну, конечно, чтоб шеф там, а шеф отдельно так работает под… под стеклом. ",
      id: "textf051ea778c3027c924042b9658661b09"
    },
