    texte101b20d362e081f053d0ffea5bd0007: {
      type: "text",
      content: "И вот, значит, весна, это уже был, значит 44-й год, весна, да? Но, а болото, как засыпали, так и засыпается. И вот это… отвоёвывают из болота вот это пространство для огорода, так вот оно всё и продолжается, и продолжается. И вот уже мы рассаду помидоров рассадили и огурцов посадили, уже появилися и, это, помидоры появилися, и огурцы появилися. И конечно, я… уже краснеть начали помидоры, я эти помидоры уже начал кушать, да. Но, а потом у меня ещё в лагере, в бараке. Я же был не в шестом блоке. А я уже попал, вот где Сашка был, они в четвёртом блоке были, я туда к ним попал. А Сашка работал вот на вот этой команде, что я вам говорил месап. Ну, тут видите, тут такое, что всё не расскажешь. Ну, вот, ну и вот, значит, у меня в лагере ребята же есть, которые меня угощают другой раз. Вот Саша, он был часовой мастер хороший, из Днепроветровской области, Водяное – есть такое село, где-то там Водяное. Я на карте его находил. Я ни разу туда не съездил, а так мне хотелось поехать и разыскать вот этого Сашу водяницкого. Но он погиб. Он погиб. Но Саша, он был часовой мастер, и работал вот в этой команде, где часовые механизмы делали. А он был ещё часовой мастер просто, с это, с советско… ну, с России будем считать, да?",
      id: "texte101b20d362e081f053d0ffea5bd0007"
    },
