    text59b692561b27f4da1d510a77a5d6c1d3: {
      type: "text",
      content: "Так я половину сюда, а половину туда /смеётся/. Вместо того, чтобы две туда бросать, мы бросаем по одной. Ну, может быть, и остальные там делают так. Я же не знаю, я голодный человек, да. Я и… я, конечно, и вот это съел, и я… по сути дела, подкрепление, это большое было подкрепление. И так я, значит, так там доработался. Я тут немножко опережаю события, когда я уже опухший, это ещё в карантине был. Ну, ладно это я перескочил. И я, значит, доработался до того, что весной, причём, причём, я это второй раз уже в эту команду попал, в гертнерай. Это первый раз, это я случайно, я там ничего и не разобрался, но я очень слабый был. Ну, ладно, это потом. Да, и вот, значит, это, когда, а вот это второй раз, значит, я когда попал, так я уже был и умнее и всё.",
      id: "text59b692561b27f4da1d510a77a5d6c1d3"
    },
