    textd32fb3451b7b3529b54610fca9fb47fa: {
      type: "text",
      content: "Приходим мы туда на объект рабочий, уже в огородничью команду, да? И там сразу разбежалися, русских там не было, там всего может быть человек пять, всего русских было /посторонний шум/, а то в основном там поляки были и эти немцы. Немцев много было, заключенных, которые ну, немцы же не будут работы эти выполнять, работать где-то, Эльбу чистить, немцы все в хороших командах работали. Да. И вот значит, это, только разошлися, а там туалет, два туалета, я уже вижу, захожу в туалет, а это, это была уже весна, наверное. Нет, это ещё зима, наверное, была, потому что ещё холодно было. И вот эти, мантель, ну, у меня была такая шинель этого французского, наверное, солдата, была на мне такая шинель. Это мне ещё дали, как переодевали меня, да? Я смотрю, что там кто-то достаёт какую-то железку и канаты, вот такие канаты, засыпанные землёй, и в этих канатах, смотрю, морковку тащит. Там рядом картошка, ну, картошка сырая, её же кушать не будешь сырой, да. А морковку… Ну, эти опытные, они же уже опытные все, и они уже знают, что вот как дал команду этот каппо, в этот ряд, в этот ряд - это разойдися, каждый своё место уже знает. Там сарайчик, в сарайчике шпатель, лопата там или что. Каждый знал, что надо брать, куда идти, что будет делать. Мы почти все уже знали свою работу. Только форарбайтер скажет: «Ты, ты, ты пошли туда-то, пошли туда-то, там копать что-то, подвязывать там что-то», да?",
      id: "textd32fb3451b7b3529b54610fca9fb47fa"
    },
