    text578b217674f1d8113a1cd257d35d1df5: {
      type: "text",
      content: "Г. К.: Да. И вот значит – бац, идёт команда вот эта. И в их, ну, что, когда построение было, утреннее, утренняя… утренняя проверка, когда кончится, значит, голосистый такой был лагерьэльстер. Это из заключённого, кроме коменданта, комендант, эсэсовцы – это одно. А потом кроме этого, ещё есть лагерьэльстер. Он над всем лагерем, он над всем лагерем командует глоткой. Все команды по лагерю передаёт, у него такая глотка была, что его за 10 км слышно, как он кричит: «Арбайтскоманда, /смеётся/ яумен ренстен или лингст». «Марш!» – кричит, когда, ну, он командует, когда в лагере какое-то происходит, или на аппельплац выходит, на проверку или провожает. Так вот этот лагерьэльстер, он красивый такой мужчина был, да. И вот значит, это, ну, как он, подаст команду, арбайтскоманду – это после утренней проверки сразу каждый знает, где его команда строится, всегда, постоянно где-то на одном месте они всегда строятся. И вот у них команды, кейпнерай гейтнерай называется, она называется кейпнерай – это огородничья команда. И к ним не пришёл, ну, может, заболел, то ли заболел, то ли, ну, я не знаю, где… Но факт тот, что у них два человека, только три человека в задней пятёрке идёт только три человека. ",
      id: "text578b217674f1d8113a1cd257d35d1df5"
    },
